import CelebretiesBox from "./CelebretiesBox";
import CelebData from "../celebData";
import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

function MiddlePage() {
  let something = (
    <div>
      {CelebData.map((myCeleb, index) => {
        return <CelebretiesBox myCelebData={myCeleb} key={index} />;
      })}
    </div>
  );
  console.log(something);
  const result = [];
  for (let i = 0; i < something.length; i += 3) {
    let x = (
      <Row key={i}>
        <Col>{something[i]}</Col>
        <Col>{something[i + 1]}</Col>
        <Col>{something[i + 2]}</Col>
      </Row>
    );
    result.push(x);
  }
  console.log(result);
  return something;
}

export default MiddlePage;
